create TABLE IF NOT EXISTS `district`
(
    `created_at` DATETIME    NOT NULL DEFAULT CURRENT_TIMESTAMP,
    `updated_at` DATETIME    NOT NULL DEFAULT CURRENT_TIMESTAMP ON update CURRENT_TIMESTAMP,
    `code`       VARCHAR(30) NOT NULL,
    `name`  VARCHAR(150) NOT NULL,
    `province_code`       VARCHAR(30)  NULL,
    `mobio_code`    VARCHAR(30)  NULL,
    `mobio_name`       VARCHAR(150)  NULL,
    `mobio_province_code`    VARCHAR(30)  NULL,
    `mercury_name`       VARCHAR(150)  NULL,
    PRIMARY KEY (`code`)
);

CREATE INDEX district_province_code_idx
ON district (province_code);

